import React, { Component } from 'react' 

import Card from 'react-bootstrap/Card'

function CardPromotion() {
    return (
        <Card className="flex mr-0.5 items-end justify-center flex-wrap gap-6">
            <Card.Body className="flex m-1.5 px-12 shadow-boxShadow bg-background-color">
                <Card.Header className="text-text-color"> Minimo de 15 pessoas <br /> </Card.Header>

            </Card.Body>
        </Card>
    );
}

class Rooms extends Component {
    render() {
        return (
            <div className='contaienr'>
                <h1 className="text-title-color flex justify-self-center p-8">Salas</h1>
                <h3 className='text-text-color mb-4 '>
                    Atenção: É proibido o uso de confetes, serpentinas ou qualquer outro material decorativo que dificultem a limpeza do ambiente. 
                    No descumprimento das mesmas, será cobrado taxa adicional.
                </h3>
                <section className="flex-col grid justify-items-stretch place-content-center">
                    <p className=" text-text-color flex justify-self-center p-8">
                        Faça sua festa, festa de aniversario, happy hour, confraternização, etc, no melhor karaokê de São Paulo.
                    </p>
                    <h2 className="text-title-color flex justify-self-center p-8">
                        Pacote Especial
                    </h2>
                    <CardPromotion />
                </section>
            </div>
        );
    }
}

export default Rooms
